import axios from '../../node_modules/axios';

const USER_API_BASE_URL = "http://localhost:8084/api/v1";

class UserService {

    createUser(user){
        console.log(user)
        return axios.post(USER_API_BASE_URL+"/users",user);
    }

    createAd(advertisement)
    {
        return axios.post(USER_API_BASE_URL+"/adv",advertisement);
    }

}

export default new UserService()
